        <div class="bg-blue-600 h-2.5 rounded-full"
             [style.width]="percentage + '%'">
        </div>
      </div>
      <p class="text-center mt-2">
        Progress: {{ current }}/{{ total }} questions
      </p>
    </div>
  `
})
export class ProgressBarComponent {
  @Input() current: number = 0;
  @Input() total: number = 0;
  @Input() percentage: number = 0;
}

import { Component, Input, Output, EventEmitter } from '@angular/core';
import { CommonModule } from '@angular/common';
import { Question } from 'src/app/core/entities/question.entity';

@Component({
  selector: 'app-question-card',
  template: `
    <div class="p-4 bg-white rounded-lg shadow-md">
      <div class="flex items-center justify-between mb-4">
        <h3 class="text-lg font-semibold">{{ question.text }}</h3>
        <span class="px-3 py-1 text-sm rounded-full"
              [ngClass]="getStatusClass()">
          {{ question.category }}
        </span>
      </div>
      <div class="flex justify-end space-x-2" *ngIf="!question.isAnswered">
        <button
          (click)="onAnswer(true)"
          class="px-4 py-2 bg-green-500 text-white rounded hover:bg-green-600 transition-colors">
          Correct Answer
        </button>
        <button
          (click)="onAnswer(false)"
          class="px-4 py-2 bg-red-500 text-white rounded hover:bg-red-600 transition-colors">
          Incorrect Answer
        </button>
      </div>
      <div *ngIf="question.isAnswered" class="mt-2">
        <p [ngClass]="question.isCorrect ? 'text-green-600' : 'text-red-600'">
          {{ question.isCorrect ? ' Answered correctly' : ' Answered incorrectly' }}
        </p>
      </div>
    </div>
  `
})
export class QuestionCardComponent {
  @Input() question!: Question;
  @Output() answered = new EventEmitter<{ id: number; isCorrect: boolean }>();

  onAnswer(isCorrect: boolean) {
    this.answered.emit({ id: this.question.id, isCorrect });
  }

  getStatusClass(): string {
    if (!this.question.isAnswered) {
      return 'bg-blue-100 text-blue-800';
    }
    return this.question.isCorrect
      ? 'bg-green-100 text-green-800'
      : 'bg-red-100 text-red-800';
  }
}

import { Component } from '@angular/core';
import { CommonModule } from '@angular/common';
import { CategorySelectionComponent } from '../category-selection/category-selection.component';
import { QuestionViewerComponent } from '../question-viewer/question-viewer.component';
import { ProgressBarComponent } from './progress-bar/progress-bar.component';
import { Question } from '../core/entities/question.entity';
import { GetQuestionsByCategoryUseCase } from '../core/use-cases/get-questions-by-category.use-case';
import { MarkQuestionAnsweredUseCase } from '../core/use-cases/mark-questions-answered.use-case';

@Component({
  selector: 'app-question-list',
  template: `
    <div class="container mx-auto px-4 py-8">
      <div *ngIf="!selectedCategory" class="mb-8">
        <h2 class="text-2xl font-bold mb-6">Select a Category</h2>
        <app-category-selection
          (categorySelected)="onCategorySelected($event)">
        </app-category-selection>
      </div>

      <div *ngIf="selectedCategory && questions.length > 0">
        <div class="mb-8">
          <button
            (click)="resetCategory()"
            class="text-blue-600 hover:text-blue-800">
             Back to Categories
          </button>
        </div>

        <app-question-viewer
          [questions]="questions"
          (answered)="onQuestionAnswered($event)">
        </app-question-viewer>

        <app-progress-bar
          [current]="answeredCount"
          [total]="totalQuestions"
          [percentage]="progressPercentage">
        </app-progress-bar>
      </div>
    </div>
  `
})
export class QuestionListComponent {
  selectedCategory: string | null = null;
  questions: Question[] = [];

  get answeredCount(): number {
    return this.questions.filter(q => q.isAnswered).length;
  }

  get totalQuestions(): number {
    return this.questions.length;
  }

  get progressPercentage(): number {
    return (this.answeredCount / this.totalQuestions) * 100;
  }

  constructor(
    private getQuestionsByCategoryUseCase: GetQuestionsByCategoryUseCase,
    private markQuestionAnsweredUseCase: MarkQuestionAnsweredUseCase
  ) {}

  onCategorySelected(event: {categoryId: string, questionCount: number}) {
    this.selectedCategory = event.categoryId;
    this.getQuestionsByCategoryUseCase.execute(event.categoryId).subscribe(
      questions => {
        this.questions = questions.slice(0, event.questionCount);
      }
    );
  }

  resetCategory() {
    this.selectedCategory = null;
    this.questions = [];
  }

  onQuestionAnswered(event: { id: number; isCorrect: boolean }) {
    this.markQuestionAnsweredUseCase.execute(event.id, event.isCorrect)
      .subscribe(() => {
        const question = this.questions.find(q => q.id === event.id);
        if (question) {
          question.isAnswered = true;
          question.isCorrect = event.isCorrect;
        }
      });
  }
}

import { Component, Input, Output, EventEmitter } from '@angular/core';
import { CommonModule } from '@angular/common';
import { Question } from '../core/entities/question.entity';

@Component({
  selector: 'app-question-viewer',
  template: `
    <div class="bg-white rounded-lg shadow-md p-6">
      <div class="flex justify-between items-center mb-6">
        <button
          (click)="previousQuestion()"
          [disabled]="currentIndex === 0"
          class="px-4 py-2 text-gray-600 hover:text-gray-800 disabled:opacity-50">
           Previous
        </button>
        <span class="text-gray-600">Question {{ currentIndex + 1 }} of {{ totalQuestions }}</span>
        <button
          (click)="nextQuestion()"
          [disabled]="currentIndex === totalQuestions - 1"
          class="px-4 py-2 text-gray-600 hover:text-gray-800 disabled:opacity-50">
          Next 
        </button>
      </div>

      <div class="mb-8">
        <h3 class="text-xl font-semibold mb-4">{{ currentQuestion?.text }}</h3>
      </div>

      <div class="flex justify-end space-x-4" *ngIf="!currentQuestion?.isAnswered">
        <button
          (click)="onAnswer(false)"
          class="px-6 py-2 bg-red-500 text-white rounded hover:bg-red-600 transition-colors">
          Incorrect
        </button>
        <button
          (click)="onAnswer(true)"
          class="px-6 py-2 bg-green-500 text-white rounded hover:bg-green-600 transition-colors">
          Correct
        </button>
      </div>

      <div *ngIf="currentQuestion?.isAnswered" class="mt-4">
        <p [ngClass]="currentQuestion?.isCorrect ? 'text-green-600' : 'text-red-600'">
          {{ currentQuestion?.isCorrect ? ' Answered correctly' : ' Answered incorrectly' }}
        </p>
      </div>
    </div>
  `
})
export class QuestionViewerComponent {
  @Input() questions: Question[] = [];
  @Output() answered = new EventEmitter<{ id: number; isCorrect: boolean }>();

  currentIndex = 0;

  get currentQuestion(): Question | undefined {
    return this.questions[this.currentIndex];
  }

  get totalQuestions(): number {
    return this.questions.length;
  }

  previousQuestion() {
    if (this.currentIndex > 0) {
      this.currentIndex--;
    }
  }

  nextQuestion() {
    if (this.currentIndex < this.questions.length - 1) {
      this.currentIndex++;
    }
  }

  onAnswer(isCorrect: boolean) {
    if (this.currentQuestion) {
      this.answered.emit({ id: this.currentQuestion.id, isCorrect });
    }
  }
}

